import org.joget.apps.app.service.AppUtil;
import org.joget.apps.datalist.model.DataList;
import java.util.Map;
import java.util.regex.Matcher;
import java.util.regex.Pattern;
import org.joget.commons.util.StringUtil;

String replaceValueFromIteratorRecord(String expr, Map row, DataList dataList) {
    Pattern pattern = Pattern.compile("\\{([a-zA-Z0-9_\\.]+)\\}");
    Matcher matcher = pattern.matcher(expr);

    while (matcher.find()) {
        String key = matcher.group(1);
        String value = "";

        if (key.equalsIgnoreCase("detail")){
                value = (String)row.get(key);
                if (value.equalsIgnoreCase("All Signed")){
                    value = "";
                } else {
                    value = "<b>Unsigned Location</b>: " + value + "<br>";
                }
            }else{
                value = (String)row.get(key);
            }

        if (value != null) {
            expr = expr.replaceAll(StringUtil.escapeRegex("{"+key+"}"), value);
        }
    }

    return expr;
}

String process(Map row, String value, DataList datalist){
    String action = row.get("action");
    String user = value;

    String content = "$form.ags_message.message["+ action + "]$";
    content = content.replaceAll("\\$", "#");
    content = AppUtil.processHashVariable(content, null, null, null);
    content = replaceValueFromIteratorRecord(content, row, datalist);
    content = content.replaceAll("\\$", "#");
    content = AppUtil.processHashVariable(content, null, null, null);

    return content;
};


return process(row, value, datalist);
